// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

contract CrossBorderPayments {

    // Struct to represent a payment
    struct Payment {
        address sender;
        address recipient;
        uint256 amount;
        bool completed;
    }

    // Mapping to store payments with unique IDs
    mapping(uint256 => Payment) public payments;

    // Counter to generate unique payment IDs
    uint256 public paymentCounter;

    // Event emitted when a new payment is initiated
    event PaymentInitiated(uint256 paymentId, address sender, address recipient, uint256 amount);

    // Event emitted when a payment is completed
    event PaymentCompleted(uint256 paymentId);

    // Function to initiate a cross-border payment
    function initiatePayment(address _recipient, uint256 _amount) external {
        require(_recipient != address(0), "Recipient address cannot be zero.");
        require(_amount > 0, "Payment amount must be greater than zero.");

        paymentCounter++;

        Payment memory newPayment = Payment({
            sender: msg.sender,
            recipient: _recipient,
            amount: _amount,
            completed: false
        });

        payments[paymentCounter] = newPayment;

        // Emit the event
        emit PaymentInitiated(paymentCounter, msg.sender, _recipient, _amount);
    }

    // Function to complete a payment
    function completePayment(uint256 _paymentId) external {
        require(_paymentId > 0 && _paymentId <= paymentCounter, "Invalid payment ID.");

        Payment storage payment = payments[_paymentId];

        require(msg.sender == payment.sender, "Only the sender can complete the payment.");
        require(!payment.completed, "Payment is already completed.");

        // Implement actual payment processing logic here
        // For simplicity, we'll just mark the payment as completed in this example.

        payment.completed = true;

        // Emit the event
        emit PaymentCompleted(_paymentId);
    }
}

